INSERT INTO `course` VALUES (1,'WSE_Sale Training_201611_1','ABC IT - Computer Training Suite','<p><br></p><h4 class=\"crsbx\">CERTIFICATION</h4><p>\n							<br></p><p class=\"justify\">To qualify for your official ALISON Diploma, Certificate or PDF you must <strong>study</strong> and complete all modules and score 80% or more in each of the <strong>course assessments</strong>. A link to purchase your Diploma <strong>certificate</strong> will then appear under the My Certificates heading of your My Account page.</p><p>\n\n							<br></p><h4 class=\"crsbx\">LEARNING OUTCOMES</h4><p>\n							<br></p><p class=\"justify\">One of the key outcomes of taking ALISON\'s ABC\n IT online course is that you will understand the functions of a \ncomputer. You\'ll learn about IT safety and environmentally friendly ways\n to dispose of computer parts. You will know the legal matters involved \nin IT and gain a greater&nbsp;<strong>knowledge</strong>&nbsp;of computer software\n and hardware. You will have the skills to manage multiple files \neffectively. This course will teach you touch typing as well as how to \nuse email and word processing applications, tasks that will help you to \naccomplish your daily goals.</p><p>\n\n							\n\n							\n								\n									<br></p><p><strong><span class=\"alternative-font\">Share This Course!</span></strong></p><p><br></p>','2016-04-01','2016-04-20','20160505111727_Chrysanthemum.jpg','Sale Training','IT is a free online self-certifiable information technology (IT) course.','5;1;4;',NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(2,'WSE_Advanced techniques_201611_2','Creating Value Through Technology','<p><br>The aim of this graduate course is to discuss current issues in \ndevelopmental neurobiology. Topics will include: cell fate decisions in \nthe nervous system; axon guidance/cell migrations; synaptogenesis, \nneuronal function; genetic analysis of behavior, learning &amp; memory \n&amp; genetic models of neurodegenerative diseases. The format will \nconsist of 1 2 hour class/week. Each class will consist of a lecture \ncomponent and presentations from students. Students will be assessed \nusing two criteria: presentation of current papers from the literature \nand an NSERC style grant on a topic discussed in class. <span style=\"font-size: 36px;\"></span></p>','2016-04-26','2016-04-27','20160505011435_Koala.jpg','Advanced techniques','Digital technologies are changing extraordinarily quickly',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(3,'WSE_Sale Training_201611_3','Creating Value Through Technology','<p>ALISON\'s free, online Information Technology courses (IT courses) \ndeliver the basics and beyond in a wide range of topics, including \nnetwork security, cloud computing and more. Students also have the \nopportunity to earn diplomas in Web Business</p>','2016-04-25','2016-04-26','20160505011339_Jellyfish.jpg','Sale Training','ALISON\'s free, online Information Technology courses',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(4,'WSE_Sale Training_201611_4','Developmental Neurobiology','<p><span style=\"\">?</span>IT courses can help you \nturn&nbsp;your love of all things geek, and&nbsp;passion for a particular \nindustry, into a brilliant career as a programmer, network professional,\n technical&nbsp;support, security specialist and more. You could work in a \nvariety of areas &nbsp;from aerospace, banking and computing, through to \ne-commerce,&nbsp;manufacturing, telecommunications and travel.<br></p><br><p><br></p>','2016-04-07','2016-04-13','20160505010859_Penguins.jpg','Sale Training','The aim of this graduate course is to discuss current issues in developmental neurobiology',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(5,'WSE_Sale Training_201611_5','Digital Storytelling: Filmmaking for the Web','<p>The aim of this graduate course is to discuss current issues in \ndevelopmental neurobiology. Topics will include: cell fate decisions in \nthe nervous system; axon guidance/cell migrations; synaptogenesis, \nneuronal function; genetic analysis of behavior, learning &amp; memory \n&amp; genetic models of neurodegenerative diseases. The format will \nconsist of 1 2 hour class/week. Each class will consist of a lecture \ncomponent and presentations from students. Students will be assessed \nusing two criteria: presentation of current papers from the literature \nand an NSERC style grant on a topic discussed in class. <br></p>','2016-05-01','2016-05-01','20160505011550_Hydrangeas.jpg','Sale Training','Combine theory and practice to tell powerful stories through film online. Unleash your potential in this free online course.',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(6,'WSE_Service Training_201611_6','Learn to Code for Data Analysis','<p>Learn to Code for Data Analysis</p>','2016-04-24','2016-04-24','20160505011815_Chrysanthemum.jpg','Service Training','Learn to Code for Data Analysis',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(7,'WSE_Sale Training_201611_7','Learn to Code for Data Analysis','<p>Learn to Code for Data Analysis</p>','2016-04-24','2016-04-24','20160505011836_Penguins.jpg','Sale Training','Learn to Code for Data Analysis',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(8,'WSE_Sale Training_201611_8','Learn to Code for Data Analysis','<p>Learn to Code for Data Analysis</p>','2016-04-24','2016-06-08','20160505011855_Tulips.jpg','Sale Training','Learn to Code for Data Analysis',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(9,'WSE_Sale Training_201611_9','Learn to Code for Data Analysis','<p>Learn to Code for Data Analysis</p>','2016-04-26','2016-04-28','20160505011915_Jellyfish.jpg','Sale Training','Learn to Code for Data Analysis',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(10,'WSE_Service Training_201611_10','Learn to Code for Data Analysis','<p>Learn to Code for Data Analysis</p>','2016-04-26','2016-04-27','20160505011933_Lighthouse.jpg','Service Training','Learn to Code for Data Analysis',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(11,'WSE_Service Training_201611_11','Learn to Code for Data Analysis','<p>Learn to Code for Data Analysis</p>','2016-04-27','2016-04-27','20160505011955_Hydrangeas.jpg','Service Training','Learn to Code for Data Analysis',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(12,'WSE_Service Training_201611_12','Learn to Code for Data Analysis','<p>Learn to Code for Data Analysis<br></p>','2016-05-03','2016-06-11','20160502034758_Lighthouse.jpg','Service Training','Learn to Code for Data Analysis','1;3;',NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(13,'WSE_1_201607_13','Learning Online: Searching and Researching','<p>ALISON\'s free, online Information Technology courses (IT courses) \ndeliver the basics and beyond in a wide range of topics, including \nnetwork security, cloud computing and more. Students also have the \nopportunity to earn diplomas in Web Business<br></p>','2016-05-04','2016-05-20','20160504090745_Tulips.jpg','Service Training','The formal graduate courses offered within the Molecular Genetics',NULL,NULL,NULL,'lms@wallstreetenglish.edu.vn','2016-07-13',NULL,'0'),(14,'WSE_Service Training_201611_14','Managing Your Identity','<p>This course is part of a collection from the <a href=\"https://www.futurelearn.com/partners/university-of-leeds\">University of Leeds</a>\n  which have been specifically designed for those studying at school or \ncollege. All of the courses will help to enrich and extend your \nknowledge in a specific topic and develop your transferable skills.  \nThese courses will help you with making decisions about which subject to\n study at university and will give you examples and evidence when \ndeveloping your university application.</p><p>Throughout the course you will join a community \nof online learners, providing an opportunity for interactive learning \nwith other students both in the UK and internationally.</p><p><br></p>','2016-05-04','2016-05-19','20160504111802_Hydrangeas.jpg','Service Training','Reflect on how you want to present yourself online and take positive steps towards these goals.',NULL,NULL,NULL,'bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(15,'WSE_null_201606_15',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'lms@wallstreetenglish.edu.vn','2016-06-29',NULL,'0'),(16,'WSE_Sale Training_201611_16','New course','<p>New course............</p>','2016-06-28','2016-07-09','20160628105117_images.jpg','Sale Training','New course............',NULL,'khue.dn@wallstreetenglish.edu.vn','2016-06-28','bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(17,'WSE_1_201607_17','Day 1 - Service training induction','<p>This is the first day of training</p>','2016-07-07','2016-07-12',NULL,'Service Training','Learning objectives\n1) ....\n2) ...',NULL,'bao.n@wallstreetenglish.edu.vn','2016-07-07','lms@wallstreetenglish.edu.vn','2016-07-15',NULL,'0'),(18,'WSE_1_201607_18','Course to delete','<p>This is a course to delete<br></p>','2016-07-13','2016-07-31','20160713031232_mental-health-concept-in-playful-style-with-egg-characters.jpg','Service Training','Short description',NULL,'lms@wallstreetenglish.edu.vn','2016-07-13','lms@wallstreetenglish.edu.vn','2016-07-13',NULL,'0'),(19,'WSE_1_201607_19','Building rapport & PT workflow','<p><img data-filename=\"trapped-danger-owl-escape.jpg\" src=\"data:image/jpeg;base64,\" style=\"width: 568px;\"><br></p>','2016-07-13','2016-07-31','20160713033037_value-curious.jpg','Service Training','Short description',NULL,'lms@wallstreetenglish.edu.vn','2016-07-13','lms@wallstreetenglish.edu.vn','2016-07-15',NULL,'0'),(20,'WSE_1_201607_20','Test quiz only','<p>Description </p><p><br></p>','2016-07-13','2016-07-31',NULL,'Service Training','Shrt description',NULL,'lms