s for the 2nd lesson:&nbsp;</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">1. Second Lesson Process to follow up students during the lesson</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">2. Second Lesson reading material&nbsp;</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">3. Second Lesson Video&nbsp;</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Should you have any questions, kindly contact us via email or discuss with us in the training</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Best,&nbsp;</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Service Trainers</span><br></p>','2016-09-11','2016-09-16',NULL,'Service Training','No description',NULL,'anh.ndtq@wallstreetenglish.edu.vn','2016-09-13','anh.ndtq@wallstreetenglish.edu.vn','2016-09-13',NULL,'1'),(52,'WSE_Service Training_201611_52','FIRST LESSON','The First Lesson is a very important skill that the PTs need to master','2016-09-14','2016-12-31','20160913043612_choice destiny.jpg','Service Training','very important skill that the PTs need to master',NULL,'van.pth@wallstreetenglish.edu.vn','2016-09-13','van.pth@wallstreetenglish.edu.vn','2016-11-10',NULL,'1'),(53,'WSE_Service Training_201611_53','Test Bao 26th Sep','<p>Test Bao 26th Sep<br></p>','2016-09-26','2016-10-30',NULL,'Service Training','Test Bao 26th Sep',NULL,'lms@wallstreetenglish.edu.vn','2016-09-26','bao.n@wallstreetenglish.edu.vn','2016-11-04',NULL,'0'),(54,'WSE_Service Training_201611_54','NSE Training for Service Staff','<p>Dear Team,&nbsp;</p><p>To prepare well for the NSE Training, please finish the below assignments:</p><p>1. NSE First Lesson</p><p>2. Class Booking (updated at 1:50pm, Nov 15th)</p><p>3. Placement Test</p><p>4. Student &amp; Staff tools</p><p>5. FAQs &amp; Treating Objections</p><p>6. Study Plan Session</p><p>____________________________________________________________________________</p><p><b><font color=\"#ff0000\">Kindly read the instructions for the assignment carefully:</font></b></p><p>1. The deadline for those assignments is <span style=\"background-color: rgb(255, 255, 0);\">24:00 18 November</span>. When it turns to 19 Nov, the classroom will be automatically locked.</p><p>2. <b>All SOs and PTs (full time &amp; part time)</b>&nbsp;need to do <b>all assignments</b></p><p>3. Don\'t use Internet Explorer to run the classroom. But you can use other Browsers</p><p>4. All quizzes have the time limit which is shown at the top right corner.</p><p>5. You only have 1 attempt to do the quiz. Please <b><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#ff0000\">don\'t click \"Finish</font></span><font color=\"#ff0000\" style=\"background-color: rgb(255, 255, 255);\">\"</font></b> if you haven\'t completed all the questions. &nbsp;</p><p>6. Multiple answers will be noticed on the questions. The rests have only 1 correct answer.</p><p>____________________________________________________________________________</p><p>Please arrange your time to finish all assignments before due day</p><p>Should you have any questions or suggestions, please take notes and bring it to the training.</p><p>Thank you and see you soon</p><p>Service Trainers</p>','2016-11-09','2016-11-19','20161107040808_NSE.JPG','Service Training','NSE Training for Centers',NULL,'anh.ndtq@wallstreetenglish.edu.vn','2016-11-04','van.pth@wallstreetenglish.edu.vn','2016-11-16',NULL,'1');
