INSERT INTO `material` VALUES (1,'Introduction','1.pdf',2000,'1','<p><br></p><p>This course is just one of a series of about learning online.  You \ncan sign up to the other courses in this series through the <a href=\"https://www.futurelearn.com/courses/collections/going-to-university\">Going to University</a> collection.</p><p>Many of us now have an online identity running \nalongside our everyday lives.  In this course youll consider your \nonline presence; youll discover how what we say and do online can have \nmajor implications for our real lives, and those of others.  Youll  \nalso spend time looking at how to assess and enhance our online \nidentities to ensure that you can get the most out of being yourself \nonline.</p><p><br></p>',1,NULL,NULL,0),(3,'Video Training','https://www.youtube.com/embed/V4jMYVWifiA',0,'3','<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/V4jMYVWifiA\" frameborder=\"0\" allowfullscreen></iframe>',1,NULL,NULL,1),(8,'Quiz template','20160523113622_Quiz template',0,'2','SDFSD\nSDFS\nFSDF\nSDFSDF\nSDFSFS SFSDF\nThe Spring Framework provides a comprehensive programming and configuration model for modern Java-based enterprise applications - on any kind of deployment platform. A key element of Spring is infrastructural support at the application level: Spring focuses on the \"plumbing\" of enterprise applications so that teams can focus on application-level business logic, without unnecessary ties to specific deployment environments.\nFeatures\n\n    Dependency Injection\n    Aspect-Oriented Programming including Spring\'s declarative transaction management\n    Spring MVC web application and RESTful web service framework\n    Foundational support for JDBC, JPA, JMS\n    Mu\n\nFDSDF\nDF\n',1,9,NULL,2),(9,'New Material 2','https://www.youtube.com/watch?v=B3vIIGAk2zo',0,'3',NULL,12,NULL,NULL,NULL),(10,'Quiz',NULL,0,'4',NULL,1,10,'1gJxq5nT5pSIrtphn_is6T_DbLeIOus4fCDzuadVkz8o',3),(11,'New Materia3','12121',0,'4',NULL,13,11,NULL,NULL),(12,'New Material 3','https://www.youtube.com/watch?v=B3vIIGAk2zo',0,'3',NULL,13,NULL,NULL,NULL),(13,'New Material 2',NULL,0,'2',NULL,13,NULL,NULL,NULL),(14,'New Material 1',NULL,0,'1','<p>2132132</p>',13,NULL,NULL,NULL),(15,'New Material 1',NULL,0,'4',NULL,14,12,NULL,NULL),(16,'New Material 1',NULL,0,'1','<p>12121</p>',15,13,NULL,NULL),(17,'New Material 2',NULL,0,'4',NULL,16,14,NULL,NULL),(18,'New Material',NULL,0,'4',NULL,16,15,NULL,NULL),(19,'1212','https://www.youtube.com/watch?v=B3vIIGAk2zo',0,'3',NULL,16,NULL,NULL,NULL),(20,'New Material 21212',NULL,0,'4',NULL,16,16,NULL,NULL),(21,'New Material 4',NULL,0,'1','<p>12121</p>',16,NULL,NULL,NULL),(22,'New Material 3',NULL,0,'4',NULL,16,17,NULL,NULL),(23,'Introduction',NULL,0,'1','<p><br></p><p>Examples of how you, as an application developer, can benefit from the Spring platform:</p><div class=\"itemizedlist\"><ul class=\"itemizedlist\" style=\"list-style-type: disc; \"><li class=\"listitem\">Make a Java method execute in a database transaction without having to deal with\ntransaction APIs.\n</li><li class=\"listitem\">\nMake a local Java method a remote procedure without having to deal with remote APIs.\n</li><li class=\"listitem\">\nMake a local Java method a management operation without having to deal with JMX APIs.\n</li><li class=\"listitem\">\nMake a local Java method a message handler without having to deal with JMS APIs.\n</li></ul></div><p><br></p>',17,NULL,NULL,NULL),(24,'Quiz','https://drive.google.com/open?id=1JVX9P_b7cJa1ETXp_PX3hEBBhDw31bvi_kr0QeuiPfg',0,'4',NULL,17,18,NULL,NULL),(25,'Video','https://www.youtube.com/watch?v=8dCSyzgqWI4',0,'3',NULL,17,NULL,NULL,NULL),(27,'New Material','https://docs.google.com/spreadsheets/d/1JVX9P_b7cJa1ETXp_PX3hEBBhDw31bvi_kr0QeuiPfg/edit#gid=0',0,'4',NULL,19,22,NULL,NULL),(28,'New Material',NULL,0,'2',NULL,19,NULL,NULL,NULL),(29,'Video1','https://www.youtube.com/embed/8dCSyzgqWI4',0,'3',NULL,19,NULL,NULL,NULL),(30,'Introduction',NULL,0,'1','<p><br></p><div class=\"short_intro txt_666\">Ba ngy qua, h?n 2 t?n c nui cng \nhng tr?m kg c bi?n t?i Th?a Thin - Hu? ch?t d?t b?, trong khi nguyn \nnhn c ch?t ? b?n t?nh mi?n Trung ?ang ???c ?i?u tra.</div><p>\n                                                    \n                    	\n                        <br></p><p class=\"Normal\">\n	Sng 4/5, l?c l??ng ch?c n?ng t?nh Th?a Thin - Hu? cng ng??i dn th? \ntr?n Thu?n An (huy?n Ph Vang) v x H?i D??ng (th? x H??ng Tr) ? thu\n gom c bi?n, c nui ch?t hng lo?t ?? tiu h?y, ng?n ch?n tnh tr?ng \ns? d?ng, mua bn c ch?t. C l?ng ? Thu?n An v H?i D??ng ???c nui ngay\n c?a bi?n.</p><p><br></p>',19,NULL,NULL,NULL),(31,'quiz 2','https://drive.google.com/open?id=1JVX9P_b7cJa1ETXp_PX3hEBBhDw31bvi_kr0QeuiPfg',0,'4',NULL,19,21,NULL,NULL),(32,'Quiz','WSE_quiz_template',0,'4',NULL,20,24,NULL,3),(33,'Video','https://www.youtube.com/embed/V4jMYVWifiA',0,'3',NULL,2,NULL,NULL,NULL),(34,'Quiz','https://spreadsheets.google.com/feeds/worksheets/1KLjTUfa7XENDWF26brHqm7PkeMmPdoBaN-Fym56p9MA/private/full',0,'4',NULL,2,25,NULL,NULL),(35,'Introduction',NULL,0,'1','<p><section class=\"run-trailer\"><div class=\"video-container video-container--small\"><br></div></section></p><div class=\"run-details\">\n              <div class=\"run-overview-main\">\n                \n                <section class=\"run-trailer\">\n                  \n                  <div class=\"video-container video-container--small\">\n                    \n                    </div></section></div></div><p><section class=\"run-trailer\"><div class=\"video-container video-container--small\">\n                  </div>\n                  <div class=\"video-options\">\n                    <div class=\"video-options__transcript\">\n                    </div>\n                    <div class=\"video-options__video\">\n                      Download video:\n                      <a class=\"download\" data-video-quality=\"SD\" href=\"https://view.vzaar.com/5705654/download\">standard</a>\n                      or\n                      <a class=\"download\" data-video-quality=\"HD\" href=\"https://view.vzaar.com/5705654/download/hd\">HD</a>\n                    </div>\n                  </div>\n                </section>\n                \n                  <header class=\"header header-section\">\n                    <h2 class=\"headline headline-primary headline-strong\">About the course</h2>\n                  </header>\n                  \n                    <br></p><p>This course is just one of a series of about \nlearning online.  You can sign up to the other courses in this series \nthrough the <a href=\"https://www.futurelearn.com/courses/collections/going-to-university\">Going to University</a> collection.</p><p>\n                    \n                    <br></p><p>Many of us now have an online identity running \nalongside our everyday lives.  In this course youll consider your \nonline presence; youll discover how what we say and do online can have \nmajor implications for our real lives, and those of others.  Youll  \nalso spend time looking at how to assess and enhance our online \nidentities to ensure that you can get the most out of being yourself \nonline.</p><p>\n                    \n                    <br></p><h3 id=\"note-for-students\">Note for students</h3><p>This course is part of a collection from the <a href=\"https://www.futurelearn.com/partners/university-of-leeds\">University of Leeds</a>\n  which have been specifically designed for those studying at school or \ncollege. All of the courses will help to enrich and extend your \nknowledge in a specific topic and develop your transferable skills.  \nThese courses will help you with making decisions about which subject to\n study at university and will give you examples and evidence when \ndeveloping your university application.</p><p>\n                    \n                    <br></p><p>Throughout the course you will join a community \nof online learners, providing an opportunity for interactive learning \nwith other students both in the UK and internationally.</p><p>Each course is designed to complement your existing studies and aims to:</p><p>\n                    \n                    <br></p><ul><li>provide evidence for UCAS applications and prepare you for university</li><li>help you to gain new skills, think critically and learn independently</li><li>encourage online / social learning</li><li>develop collaboration and analytical skills</li><li>embed current research into your online learning</li></ul><p><br></p>',20,NULL,NULL,2),(36,'Course Content',NULL,0,'1','<p>The aim of this graduate course is to discuss current issues in \ndevelopmental neurobiology. Topics will include: cell fate decisions in \nthe nervous system; axon guidance/cell migrations; synaptogenesis, \nneuronal function; genetic analysis of behavior, learning &amp; memory \n&amp; genetic models of neurodegenerative diseases. The format will \nconsist of 1 2 hour class/week. Each class will consist of a lecture \ncomponent and presentations from students. Students will be assessed \nusing two criteria: presentation of current papers from the literature \nand an NSERC style grant on a topic discussed in class. <br><br></p>',9,NULL,NULL,NULL),(37,'Quiz','https://spreadsheets.google.com/feeds/worksheets/1KLjTUfa7XENDWF26brHqm7PkeMmPdoBaN-Fym56p9MA/private/full',0,'4',NULL,9,26,NULL,NULL),(38,'Quiz','WSE_quiz_template',0,'4',NULL,21,37,NULL,3),(39,'Introduction',NULL,0,'1','<p>ALISON\'s free, online Information Technology courses (IT courses) \ndeliver the basics and beyond in a wide ra<b>nge of topics, including \nnetwork security, cloud computing and more. Students also have the \nopportunity</b><br></p>',21,NULL,NULL,0),(41,'New Material',NULL,0,'2',NULL,22,NULL,NULL,NULL),(42,'Test google driver','20160523061632_test.html',0,'2',NULL,1,NULL,NULL,4),(43,'Quiz','WSE_quiz_template',0,'4',NULL,3,31,NULL,2),(44,'Document','20160524024732_quiz 2.xlsx',0,'2',NULL,3,