aking center? *','10. What is NOT the task that PTs do in the Speaking center? *','1','PT workflow',''),(1044,'Single choice','2',1,'1','Customer Relation Officer (CRO)',112,'11. Who will frequently call our students to check the quality of our service? *','11. Who will frequently call our students to check the quality of our service? *','1','PT workflow',''),(1045,'Single choice','1',1,'1','The feeling of trust and familiarity with someone',112,'1. What is rapport? *','1. What is rapport? *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1046,'Single choice','3',1,'1','All are correct',112,'2. Why is rapport important? *','2. Why is rapport important? *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1047,'Single choice','1',1,'1','Body language',112,'3. Which element of communication is the most important? *','3. Which element of communication is the most important? *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1048,'Multiple choice','2,3,4,5',1,'1','Voice, Tone (pitch), Tempo (speed), Volume (loudness)',112,'4. The \"Tonality\" element includes: *','4. The \"Tonality\" element includes: *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1049,'Multiple choice','3,4,5,6,7',1,'1','Posture, Gestures, Facial expressions, Eye contact, Breathing',112,'5. The \"Body language\" element includes: *','5. The \"Body language\" element includes: *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1050,'Single choice','2',1,'1','I observe that person, I notice small changes in their tonality and body language, I don\'t judge their tonality or body language',112,'6. What do you do when you calibrate someone? *','6. What do you do when you calibrate someone? *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1051,'Single choice','2',1,'1','After 5 sec, I will copy their action naturally',112,'7. What do you do when you match or mirror someone? *','7. What do you do when you match or mirror someone? *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1052,'Single choice','4',1,'1','All are correct',112,'8. In the step of Pacing and Leading, we.... *','8. In the step of Pacing and Leading, we.... *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1053,'Multiple choice','1,2,3,4,5,6',1,'1','Listen, Give a gift, Give a referral, Tell a story, Give good service, Pay a compliment',112,'9. Choose the other ways to build rapport *','9. Choose the other ways to build rapport *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1054,'Single choice','6',1,'1','All are correct',112,'10. Why should we use Agreement Frame? *','10. Why should we use Agreement Frame? *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1055,'Multiple choice','1,3,4,6,7',1,'1','I agree, I appreciate, I respect, and, therefore',112,'11. What are the words we usually use in Agreement Frame? *','11. What are the words we usually use in Agreement Frame? *','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1056,'Single choice','2',1,'1','I appreciate your effort to come here from very far and I can see you are eager to start studying. As this First Lesson has already started for 20 min, I will book another class for you to make sure you have a great start and study effectively',112,'12. Scenario: A PT is trying to convince a student to re-book another First Lesson, as that student comes late 20 min for the class. Student insists to join the class. His reason is that his house is very far from the center and this is the first day, it should be tolerated. Which one is the best use of Agreement Frame? *','12. Scenario: A PT is trying to convince a student to re-book another First Lesson, as that student comes late 20 min for the class. Student insists to join the class. His reason is that his house is very far from the center and thi