ltimedia lesson (on the computer). One student keeps asking you questions in Vietnamese, although you replied him in English. You ask him why he keeps using Vietnamese although he could understand your English reply. He said: Because I\'m not confident with my English. It took me so much time to make a full and correct sentence, so I use Vietnamese to ask you more quickly. What would you say to convince him using English?','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1059,'Text','',0,'0','',112,'*15. Write the best Agreement Frame for the following situation (maximum 4 sentences long) *\n\nYou are booking a class for a student. To optimize the class allocation, you need to convince her to book a class with 2 other people. However that student insists to book the class that not yet opened (no student booked). Her reason is: I would like to have more time talking to teacher. If I study with 2 other people, that time will be reduced. What would you say to convince this student?','*15. Write the best Agreement Frame for the following situation (maximum 4 sentences long) *\n\nYou are booking a class for a student. To optimize the class allocation, you need to convince her to book a class with 2 other people. However that student insists to book the class that not yet opened (no student booked). Her reason is: I would like to have more time talking to teacher. If I study with 2 other people, that time will be reduced. What would you say to convince this student?','2','Building rapport','https://www.youtube.com/watch?v=dU8VH6vurXg'),(1261,'Single choice','3',1,'1','',133,'1. Which menu do you use to book classes on NSE Dashboard?','1. Which menu do you use to book classes on NSE Dashboard?','1','NSE Booking',''),(1262,'Single choice','1',1,'1','',133,'2. On NSE Booking tool, what color is ENC?','2. On NSE Booking tool, what color is ENC?','1','NSE Booking',''),(1263,'Single choice','2',1,'1','',133,'3. On NSE Booking timetable, what does the symbo