INSERT INTO `topic` VALUES (1,'ICT Support Technician','Suzanne works as a Technical Trainer in the Office of Information Technology. She teaches a variety of training classes for beginning through advanced levels including Microsoft Office, Lotus Notes, Commonspot, Adobe, Macromedia and Enterprise-wide applications. Suzanne is also involved in creating and editing software training documentation','2016-04-01','2016-04-02','20160515043641_Koala.jpg',1,NULL),(2,'Childhood in the Digital Age','<p><br></p><p>This course is just one of a series of about learning online.  You \ncan sign up to the other courses in this series through the <a href=\"https://www.futurelearn.com/courses/collections/going-to-university\">Going to University</a> collection.</p><p>Many of us now have an online identity running \nalongside our everyday lives.  In this course youll consider your \nonline presence; youll discover how what we say and do online can have \nmajor implications for our real lives, and those of others.  Youll  \nalso spend time looking at how to assess and enhance our online \nidentities to ensure that you can get the most out of being yourself \nonline.</p><p><br></p>','2016-04-02','2016-04-03','vuejs.png',1,NULL),(3,'Topic 2','<p>Tset<br></p>','2016-04-03','2016-04-04','vuejs.png',2,0),(4,'121',NULL,'2016-04-25','2016-04-26','20160424085158_Chrysanthemum.jpg',22,NULL),(5,'1','<p>12121</p>','2016-04-24','2016-04-25','20160424093802_Desert.jpg',NULL,NULL),(6,'1',NULL,'2016-04-25','2016-04-27','',NULL,NULL),(7,'1',NULL,'2016-04-24','2016-04-26','',NULL,NULL),(8,'1212','<p>1212</p>','2016-04-24','2016-04-24','',NULL,NULL),(9,'ICT Support or Test Engineers','<p><br></p><p>This course is part of a collection from the <a href=\"https://www.futurelearn.com/partners/university-of-leeds\">University of Leeds</a>\n  which have been specifically designed for those studying at school or \ncollege. All of the courses will help to enrich and extend your \nknowledge in a specific topic and develop your transferable skills.  \nThese courses will help you with making decisions about which subject to\n study at university and will give you examples and evidence when \ndeveloping your university application.</p><p>\n                    \n                    <br></p><p>Throughout the course you will join a community \nof online learners, providing an opportunity for interactive learning \nwith other students both in the UK and internationally.</p><p><br></p>','2016-04-25','2016-04-25','',8,NULL),(10,'1212','<p>12121</p>','2016-08-23','2016-05-05','20160425121621_Desert.jpg',NULL,NULL),(11,'1212','<p>12121</p>','2016-04-25','2016-04-28','20160425123749_Chrysanthemum.jpg',9,NULL),(12,'213213','<p>21321</p>','2016-04-26','2016-04-28','20160426121652_Chrysanthemum.jpg',27,NULL),(13,'12321','<p>12321</p>','2016-04-27','2016-05-05','20160426033743_Chrysanthemum.jpg',29,NULL),(14,'121','<p>1212</p>','2016-04-27','2016-04-27','20160426034535_Chrysanthemum.jpg',30,NULL),(15,'1212 1212','<p>1212</p>','2016-04-27','2016-04-28','20160426034954_Desert.jpg',31,NULL),(16,'21','<p>121321</p>','2016-04-28','2016-04-27','20160426040204_Chrysanthemum.jpg',32,NULL),(17,'Leadership - Behaviour','<p>sdf</p><p>sdf</p><p>sdfsdf</p><p>sdfsdfsdfs</p><p>sdfsdf<br></p>','2016-05-02','2016-05-04','20160502034926_Tulips.jpg',34,NULL),(19,'Topic 1','<p>Test<br></p>','2016-05-04','2016-05-05','',36,NULL),(20,'Biomedical Signal and Image Processing','<p><br></p><p>Registration for Topic Courses is done by filling out the form under \nthe topic course description.&nbsp; Only Topic Courses being offered in the \ncoming Winter or Fall will have a form available. Forms will be up on \nthe website in November for Winter courses and July for Fall courses. \nThe deadline to register is <strong>January 15</strong> for Winter courses and <strong>August 17</strong> for Fall courses.</p><p><br></p><p>Students\n from other departments must be registered in MMG1012H in order to take \ntopic courses in this department.&nbsp; Biochemistry students may use topic \ncourses from this department to count towards the module courses offered\n by the Biochemistry department (check with your home department for \ndetails). Please contact the <a href=\"mailto:graduate.coordinator@utoronto.ca\">Graduate Office</a> for more information. Note that students from other departments must also select their topics by the deadlines above.</p><p><br></p>','2016-05-04','2016-05-04','',37,0),(21,'Test Topic  - WSE','<p>Test<br></p>','2016-06-05','2016-07-07','',1,0),(22,'Tewt','<p>Test<br></p>','2016-05-21','2016-06-02','',7,NULL),(23,'Test','<p>sfdsdf<br></p>','2016-05-28','2016-06-03','',38,NULL),(24,'Test Lock','<p>Test Lock<br></p>','2016-05-04','2016-05-04','',37,1),(26,'Test 23','<p>Tes<br></p>','2016-04-03','2016-04-04','',2,1),(27,'Test 24','<p>24<br></p>','2016-04-03','2016-04-04','',2,1),(28,'Topic 1','<p>Topic 1</p>','2016-06-28','2016-06-28','20160628110016_images.jpg',40,0),(29,'Topic 2','<p>Topic 2</p>','2016-06-28','2016-06-28','20160628113124_images.jpg',40,1),(30,'Topic 3','<p>Topic 3</p>','2016-06-28','2016-06-28','',40,1),(31,'Topic 4','<p>44444444</p>','2016-06-29','2016-06-29','',41,1),(32,'Section 1 - Building rapport section','<p>Building rapport section</p><p>This should include&nbsp;</p><p>(1) a PDF on building rapport</p><p>(2) a quiz with one section on building rapport</p>','2016-07-07','2016-07-07','',42,0),(33,'Section 2 - PT workflow and building rapport','<p>Section 2 description</p><p>Section should unlock automatically upon completion of section 1</p>','2016-07-07','2016-07-07','',42,1),(34,'My section title','<p>Description<br></p>','2016-07-13','2016-07-31','20160713031653_value-curious.jpg',43,1),(35,'My section 2','<p>ewgrwerg<br></p>','2016-07-13','2016-07-31','',43,1),(36,'Building rapport 1.1','<p>In this course you will learn </p><p>(1)</p><p>(2)</p><p>...</p><p><br></p>','2016-07-13','2016-07-31','20160713033257_leap-forward.gif',44,0),(37,'Quiz section','<p>Quiz description<br></p>','2016-07-13','2016-07-13','',45,NULL),(38,'Section Title','<p>sgergerg<br></p>','2016-07-14','2016-07-14','',46,0),(39,'Test case 01 - Section 01','<p>Test case 01 - Section 01 Description<br></p>','2016-07-15','2016-07-15','20160715100846_leap-forward.gif',47,0),(40,'Test case 02 - Section 01','<p>Test case 02 - Section 01 Description<br><br></p>','2016-07-15','2016-07-31','',49,0),(41,'Test case 02 - Section 02','<p>Test case 02 - Section 02 Description</p><p>This section should be locked </p><ol><li>First item</li><li>Second item</li><li>Third item<br><br></li></ol>','2016-07-15','2016-07-31','',50,1),(42,'Section title','Description','2016-07-15','2016-07-31','',51,0),(43,'Create new material section 01','<p>Create new material section 01 desc<br></p>','2016-07-22','2016-07-22','',52,0),(44,'Test case 01 - 22 July Section 01','<p>Test case 01 - 22 July Section 01 Desc<br></p>','2016-07-22','2016-07-31','',53,0),(45,'Test quiz 3 - 22 july section 01','<p>Test quiz 3 - 22 july section 01<br></p>','2016-07-22','2016-07-22','',56,0),(46,'Test quiz 3 - 22 july section 01','<ul><li>Test quiz 3 - 22 july section 01<br></li></ul>','2016-07-22','2016-07-22','',57,0),(47,'Title section 01','<p>Long description of section 01</p><hr><p><br></p>','2016-07-22','2016-07-22','20160722041920_trapped-danger-owl-escape.jpg',58,0),(48,'section 01','<p>e<br></p>','2016-07-28','2016-07-28','',60,0),(49,'section a','<p>a<br></p>','2016-07-28','2016-07-28','',61,0),(50,'Test again 2nd Aug Section 01','<p>desc<br></p>','2016-08-01','2016-08-25',NULL,62,0),(51,'section 1','<p>e<br></p>','2016-08-01','2016-08-01','',64,0),(52,'1st of Aug - Test number of attempts (3rd time)','<p>1st of Aug - Test number of attempts (3rd time)<br></p>','2016-08-01','2016-08-01','',66,0),(54,'Test 3rd Aug Number of attempts','<p>Test 3rd Aug Number of attempts<br></p>','2016-08-03','2016-08-03',NULL,67,NULL),(55,'Test 3rd Aug Number of attempts','<p>Test 3rd Aug Number of attempts<br></p>','2016-08-03','2016-08-04',NULL,68,0),(56,'3rd Aug: test correction of optional questions','<p>3rd Aug: test correction of optional questions<br></p>','2016-08-03','2016-08-03',NULL,69,0),(57,'test expired course','<p>test expired course<br></p>','2016-08-01','2016-08-26',NULL,70,0),(58,'Test 3rd Aug - Round 2 - Number of attempts','<p>Test 3rd Aug - Round 2 - Number of attempts<br></p>','2016-08-03','2016-08-04',NULL,71,0),(59,'Test 4th Aug - Number of attempts section 1','<p>Test 4th Aug - Number of attempts section 1<br></p>','2016-08-04','2016-08-04',NULL,72,0),(60,'Test 4th Aug - Number of attempts 2','<p>Test 4th Aug - Number of attempts 2<br></p>','2016-08-04','2016-08-04',NULL,73,0),(61,'4th aug test link video','<p>4th aug test link video<br></p>','2016-08-04','2016-08-04',NULL,74,0),(62,'Section 2','<p>section 2<br></p>','2016-08-04','2016-08-04',NULL,75,0),(63,'test 4th Aug - Quiz master file','<p>test 4th Aug - Quiz master file<br></p>','2016-08-04','2016-08-04',NULL,76,0),(64,'Test 4th Aug - Quiz master file 2','<p>Test 4th Aug - Quiz master file 2<br></p>','2016-08-04','2016-08-04',NULL,77,0),(65,'et','<p>ete<br></p>','2016-08-04','2016-08-04',NULL,78,1),(66,'Test 4th Aug - Optional questions','<p>Test 4th Aug - Optional questions</p><p><img data-filename=\"GIF-bobsleigh-practice-rasta-rocket.gif\" src=\"data:image/gif;base64,\" style=\"width: 500px;\"></p><p><img data-filename=\"trapped-danger-owl-escape.jpg\" src=\"data:image/jpeg;base64,\" style=\"width: 668px;\"><br></p>','2016-08-04','2016-08-04',NULL,79,0),(67,'KPI section','<p>in this section about kpi you will learn ...<br></p>','2016-08-08','2016-08-10',NULL,84,0),(68,'Test 16th Aug - Section 01','<p>Test 16th Aug - Section 01<br></p>','2016-08-16','2016-08-26',NULL,85,0),(69,'Test 16th Aug - 1 section, 2 quiz','<p>Test 16th Aug - 1 section, 2 quiz<br></p>','2016-08-16','2016-08-28',NULL,86,0),(70,'toppic 1- 2 sections, multiple quiz','<p>Test 16th Aug - 2 sections, multiple quiz<br></p>','2016-08-16','2016-08-29',NULL,87,0),(71,'Topic 2','<p>Test 16th Aug - 2 sections, multiple quiz<br></p>','2016-08-16','2016-08-29',NULL,87,0),(72,'Customer service mindset','<p>Learning objectives</p><ul><li>Understand the service ladder</li><li>Provide delightful customer service<br></li></ul>','2016-08-16','2016-09-08',NULL,88,0),(73,'Training rules and expectations','<p>Learning objectives</p><ul><li>Have a clear understanding of your role and responsibilities</li></ul>','2016-08-16','2016-09-08',NULL,88,0),(74,'Intro about WSE & Pearson','<p>Learning objectives</p><ul><li>Understand our global footprint<br></li></ul>','2016-08-16','2016-09-08',NULL,88,0),(75,'PT & SO Workflow','<p>Learning objectives</p><ul><li>Understand how the roles of PT and SO are interrelated <br></li></ul>','2016-08-16','2016-09-08',NULL,88,0),(76,'Product & Method','<p>Learning objectives</p><ul><li>Understand the product</li><li>Be able to explain the method to any student<br></li></ul>','2016-08-16','2016-09-08',NULL,89,0),(77,'Professionalism at work','<p>Learning objectives</p><ul><li>Understand the dress code at WSE</li><li>Know what to do and not do<br><p><br></p></li></ul>','2016-08-16','2016-09-08',NULL,89,0),(78,'Second Lesson Video','<p><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Hi everyone</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Please find in this assignment the split videos of Second Lesson, numbered from 01 to 08. We believe they will help you visualize and understand a Second Lesson more easily</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><b><font color=\"#ff0000\">After you watch and read these materials, let\'s complete the quiz:</font></b><font color=\"rgba(0, 0, 0, 0.870588235294118)\">&nbsp;</font></span><a rel=\"nofollow\" target=\"_blank\" href=\"http://goo.gl/forms/rN1bMWeYiY\" style=\"font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);\">http://goo.gl/forms/rN1bMWeYiY</a><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Please notice that you can ONLY do the quiz ONCE</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Best</span><br style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\"><span style=\"color: rgba(0, 0, 0, 0.870588); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px;\">Service Trainers</span><br></p>','2016-09-11','2016-09-16',NULL,90,0),(80,'Test Bao 26th Sep','<p>Test Bao 26th Sep<br></p>','2016-09-26','2016-10-30',NULL,92,0),(81,'First Lesson Introduction','<p>In this section, you will watch the FL video to visualize how a FL looks like</p><p>You also have to &nbsp;finish some quizzes</p>','2016-09-14','2016-12-31',NULL,91,0),(82,'First Lesson (Advanced)','<p>In this topic, you will learn how to manage some unexpected situations in the FL, and also to learn how to use the script more smoothly and naturally</p>','2016-09-14','2016-10-30',NULL,93,0),(83,'The New FL','<p><span style=\"font-size: 1rem;\">In this classroom, you will be able to visualize how an NSE FL is delivered. Please finish the below tasks:</span><br></p><p>1. Watch the FL video</p><p>2. Read the FL script (English/Vietnamese)</p><p>3. Finish the quiz</p><p><span style=\"font-weight: 700;\"><font color=\"#ff0000\">Kindly read the instructions for the assignment <u>carefully</u>:</font></span></p><p>1. The deadline for those assignments is&nbsp;<span style=\"background-color: rgb(255, 255, 0);\">24:00 18 November</span>. When it turns to 19 Nov, the classroom will be automatically locked.</p><p>2.&nbsp;<span style=\"font-weight: 700;\">All SOs and PTs (full time &amp; part time)</span>&nbsp;need to do&nbsp;<span style=\"font-weight: 700;\">all assignments</span></p><p>3. Don\'t use Internet Explorer to run the classroom.&nbsp;</p><p>4. All quizzes have the time limit which is shown at the top right corner.</p><p>5. You only have <span style=\"background-color: rgb(0, 255, 255);\">1 attempt</span> to do the quiz. Please <span style=\"background-color: rgb(0, 255, 255);\">don\'t click \"<span style=\"font-weight: 700;\">Finish</span>\" </span>if you haven\'t completed all the questions. &nbsp;</p><p>6. Multiple answers will be noticed on the questions. The rests have only 1 correct answer.</p><p>Should you have any questions/suggestions, kindly take note and let us know in our training</p><p>Thank you</p><p>Service Trainers</p>','2016-11-14','2016-11-19',NULL,95,0),(84,'Student & Staff Tools Self Discovery Sheet','<p>Please kindly find the \"Staff &amp; Student Self Discovery Sheet\" below, print the paper out, follow the instructions to complete the sheet &amp; bring the paper to your NSE Training for revision and activities.&nbsp;</p>','2016-11-09','2016-11-19',NULL,98,0),(85,'Treating Objections & FAQs','<p>Please find the reading materials in the attached files and complete the quiz.</p>','2016-11-09','2016-11-19',NULL,99,0),(86,'NSE Booking','<p>Dear Service staff,</p><p>Welcome to NSE Booking Online Training. We will show you how to use NSE Booking to book ENC/CC/ SC for students.</p><p>Please check the materials in order:</p><p>1. NSE Booking - SOP (reading materials)</p><p>2. NSE Booking - Video (Updated on Nov 15, added part: 5:50 to 7:25)</p><p>3. NSE Booking Quiz</p>','2016-11-09','2016-11-19',NULL,96,0),(87,'NSE Placement Test','<p>Dear all,</p><p>Welcome to NSE Placement Test training. We\'ll show you how to:</p><p>- Create a prospect\'s account.</p><p>- Explain and instruct the test from the reading materials.</p><p>- Check Placement Test\'s result.</p><p>Please follow the steps in order:</p><p>1. Read the Placement Test Training (Powerpoint).</p><p>2. Watch the Placement Test video.</p><p>3. &nbsp;Do the NSE Placement Test &nbsp;quiz.</p><p>Thank you and have fun!</p><p>Service Trainers.</p>','2016-11-09','2016-11-19',NULL,97,0),(88,'test section NSE','<p>&nbsp;NSE</p>','2016-08-16','2016-09-08',NULL,94,NULL),(90,'Study Plan Session','<p>Please find the reading materials below</p>','2016-11-09','2016-11-19',NULL,102,0);
